        static Random rd = new Random();
        /// <summary>
        /// 取随机数
        /// </summary>
        /// <param name="qishi">起始数</param>
        /// <param name="jieshu">结束数</param>
        /// <param name="ds">决定单双数的枚举danshuang</param>
        /// <returns>返回随机数字符串</returns>
        public static int Number(int qishi, int jieshu, danshuang ds)
        {
            if (ds == danshuang.All)
            {
                return rd.Next(qishi, jieshu);
            }
            else if (ds == danshuang.Singular)
            {
                for (int i = 0; i < 100; i++)
                {
                    int danshu = rd.Next(qishi, jieshu);
                    if (danshu % 2 == 1)
                    {
                        return danshu;
                    }

                }
            }
            else if (ds == danshuang.Dual)
            {
                for (int i = 0; i < 100; i++)
                {
                    int danshu = rd.Next(qishi, jieshu);
                    if (danshu % 2 == 0)
                    {
                        return danshu;
                    }

                }
            }
            return 0;
        }       //取随机数字
        static int rep = 0;
        /// <summary>
        ///随随机数（不重复）
        /// </summary>
        /// <param name="codeCount">指定生成几位数，输入1代表1位数，输入2代表2位数，3代表3位数......</param>
        /// <returns></returns>
        public static string Number_Only(int codeCount)
        {
            string str = string.Empty;
            long num2 = DateTime.Now.Ticks + rep;
            rep++;
            Random random = new Random(((int)(((ulong)num2) & 0xffffffffL)) | ((int)(num2 >> rep)));
            for (int i = 0; i < codeCount; i++)
            {
                int num = random.Next();
                str = str + ((char)(0x30 + ((ushort)(num % 10)))).ToString();
            }
            return str;
        }                        //随机数（不重复）
        /// <summary>
        /// 随机生成数字+大写字母
        /// </summary>
        /// <param name="codeCount">指定生成几位数，输入1代表1位数，输入2代表2位数，3代表3位数......</param>
        /// <returns></returns>
        public static string Number_ABC_Only(int codeCount)
        {
            string str = string.Empty;
            long num2 = DateTime.Now.Ticks + rep;
            rep++;
            Random random = new Random(((int)(((ulong)num2) & 0xffffffffL)) | ((int)(num2 >> rep)));
            for (int i = 0; i < codeCount; i++)
            {
                char ch;
                int num = random.Next();
                if ((num % 2) == 0)
                {
                    ch = (char)(0x30 + ((ushort)(num % 10)));
                }
                else
                {
                    ch = (char)(0x41 + ((ushort)(num % 0x1a)));
                }
                str = str + ch.ToString();
            }
            return str;
        }                    //取随机数+字母（不重复）
        /// <summary>
        /// 得到随机日期
        /// </summary>
        /// <param name="time1">起始日期</param>
        /// <param name="time2">结束日期</param>
        /// <returns>间隔日期之间的 随机日期</returns>
        public static DateTime GetRandomTime(DateTime time1, DateTime time2)
        {
            Random random = new Random();
            DateTime minTime = new DateTime();
            DateTime maxTime = new DateTime();

            System.TimeSpan ts = new System.TimeSpan(time1.Ticks - time2.Ticks);

            // 获取两个时间相隔的秒数
            double dTotalSecontds = ts.TotalSeconds;
            int iTotalSecontds = 0;

            if (dTotalSecontds > System.Int32.MaxValue)
            {
                iTotalSecontds = System.Int32.MaxValue;
            }
            else if (dTotalSecontds < System.Int32.MinValue)
            {
                iTotalSecontds = System.Int32.MinValue;
            }
            else
            {
                iTotalSecontds = (int)dTotalSecontds;
            }


            if (iTotalSecontds > 0)
            {
                minTime = time2;
                maxTime = time1;
            }
            else if (iTotalSecontds < 0)
            {
                minTime = time1;
                maxTime = time2;
            }
            else
            {
                return time1;
            }

            int maxValue = iTotalSecontds;

            if (iTotalSecontds <= System.Int32.MinValue)
                maxValue = System.Int32.MinValue + 1;

            int i = random.Next(System.Math.Abs(maxValue));

            return minTime.AddSeconds(i);
        }
