                    return FemaleName[rd.Next(0, 299)].ToString();
                }
            }
            else if (xingbie == Gender.Female)
            {
                int shu = rd.Next(0, 2);
                if (shu == 0)
                {
                    return FemaleName[rd.Next(0, 299)].ToString() + FemaleName[rd.Next(0, 299)].ToString();
                }
                else
                {
